import React from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
import axios from 'axios';


function BoardList({ no, title, name, writedate, readcount, content, pass }) {
    return (
        <tbody>
            <tr>
                <td>{no}</td>
                <td>
                    <Link to={{
                        pathname: `/board/${no}`,
                        state: {
                            no,
                            title,
                            name,
                            pass,
                            content
                        }
                    }} onClick={readcount(no)}>
                        {title}
                    </Link>
                </td>
                <td>
                    {name}
                </td>
                <td>{writedate}</td>
                <td>{readcount}</td>
            </tr>
        </tbody>
    );
}

function readcount(no){
    axios.put(`http://localhost:8080/board/?no=${no}`);
}

BoardList.propTypes = {
    no: PropTypes.number.isRequired,
    title: PropTypes.string.isRequired,
    name: PropTypes.string.isRequired,
    writedate: PropTypes.string.isRequired,
    readcount: PropTypes.number.isRequired
}

export default BoardList;
